const Header = () => {
  return ( 
    <div id="logo">
				<div class="pull-left">
					<div id="flag" style={{position: "absolute", top: "-40px", zIndex: "999"}}></div>
					<a href="https://aerobasegroup.com"><img src="https://aerobasegroup.com/public/images/xlogo.png.pagespeed.ic.bzagu1WTAC.webp" id="logoimg" style={{maxHeight: "90px", width: "auto"}} alt="AeroBase Group, Inc."/></a>
				</div>
				<div id="main_nav">
					<div class="pull-right margin-bottom">
						<i class="fa fa-phone"></i>&nbsp;&nbsp;321-802-5889&nbsp;&nbsp;&nbsp;
						<i class="fa fa-fax"></i>&nbsp;&nbsp;321-733-7477
					</div>
					<form action="/search" method="post" name="mainSearchForm">
						<ul class="list-plain list-left">
							<li><input type="text" class="pull-left input-md form-control input-abg" placeholder="Search for parts .." name="term" id="global_search"/></li>
							<li><button type="submit" class="btn btn-md btn-abg pull-left">Search</button></li>
						</ul>
					</form>
				</div>
			</div>
			
   );
}
 
export default Header;
